import "./styles.css";
import { motion, useScroll, useSpring } from "framer-motion";
import Header from "./components/header";
import Profile from "./components/Profile";
import Education from "./components/Education";
import Experience from "./components/Experience";
import InterestsActivities from "./components/InterestsActivities";
import SkillsCertifications from "./components/SkillsCertification";
import Sidebar from "./components/Sidebar";
import Footer from "./components/Footer";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";


export default function App() {
  const { scrollYProgress } = useScroll();
  const scaleX = useSpring(scrollYProgress, {
    stiffness: 100,
    damping: 30,
    restDelta: 0.001
  });

  return (
    <Router>
      <div className="app-container">
        <Sidebar pageWrapId={'page-wrap'} outerContainerId={'outer-container'} />
        <motion.div className="progress-bar" style={{ scaleX }} />
        <Header />
        <Routes>
          <Route path="/" element={<Profile/>} />
          <Route path="/Education" element={<AccordionWrapper />} />
          <Route path="/Experience" element={<Experience />} />
          <Route path="/InterestsActivities" element={<InterestsActivities />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}
